import React, { useState } from 'react';
// import logo from '../images/logo.png';
import ToggleButton from 'react-toggle-button';


function Nav(props) {
  const [toggle, setToggle] = useState()
  return (
    <nav>
      <ul>
        <li>logo</li>
      </ul>
      <ul>
        <ToggleButton
          value={ props || true }
          onToggle={(value) => {
            props.setState({
              value: !value,
            })
          }} 
        />
      </ul>
    </nav>
  );
}

export default Nav;
